import React, { useEffect, useState } from 'react'
import './Display.css'
import Table from 'react-bootstrap/Table';
import axios from 'axios';
import { MyContext } from '../Form/Form'
const Display = () => {
    const {name, email, }=  useContext(MyContext)
    const [users, setUsers] = useState([])
    const getUsersData = async () => {
        const res = await axios.get("https://655997ee6981238d054cb7f1.mockapi.io/crud")
        const data = res.data
        setUsers(data)
        console.log(data)

    }

    useEffect(() => {
        getUsersData()

    }, [])


    return (
        <div className='display'>
           
            <Table variant='dark' striped bordered hover>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Mobile</th>
                        <th>Address</th>
                    </tr>
                </thead>

                {
                    users.map((elem, id) => {
                        return <tbody key={id}>
                            <tr>
                                <td>{id+1}</td>
                                <td>{elem.name}</td>
                                <td>Otto</td>
                                <td>@mdo</td>
                                <td>@ad</td>
                            </tr>


                        </tbody>
                    })
                }
            </Table>
        </div>
    )
}

export default Display
